sys_variable_value.value:
(function execute(inputs, outputs) {
  inputs = new sn_fb_wp_spoke.FacebookWorkplaceUtils().trimStringInputs(inputs);
  if (inputs.status_code == '200') {
    var data = JSON.parse(inputs.response).data;
    if (data != []) {
      data.every(function(item) {
        if (item.name === inputs.name) {
          outputs.duplicate_group = false;
          inputs.response = "Duplicate Group";
          new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().throwException(inputs, outputs);
          return false;
        } else {
          outputs.name = inputs.name;
          outputs.description = inputs.description;
          outputs.privacy = inputs.privacy;
          outputs.duplicate_group = true;
          return true;
        }
      });    
    }
  }else
  	new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().throwException(inputs, outputs);   
})(inputs, outputs);

